import store from './redux/state';
import reportWebVitals from './reportWebVitals';
import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { addPost, updateNewPostText, addNewMessage, updateNewMessageText } from "./redux/state";

export let rerenderEntireTree = () => {
	ReactDOM.render(
		<React.StrictMode>
			<App state={store.getState()} addPost={store.addPost}
				updateNewPostText={store.updateNewPostText}
				addNewMessage={store.addNewMessage} updateNewMessageText={store.updateNewMessageText} />
		</React.StrictMode>,
		document.getElementById('root')
	);
};

rerenderEntireTree(store.getState());

store.subscribe(rerenderEntireTree);



// If you want to start measuring performance in your app, pass a function
